import React, { useCallback } from 'react';
import SearchBar from './SearchBar.jsx'


function SearchComponent(){
  return (
    useM(() => (
      <div className="main-image">
        <h1>Search for Books</h1>
        <div className="filter">
          <SearchBar />
        </div>
      </div>
    ), [])
  )
}

export default <SearchComponent/>
